import React from "react";
import { Button } from "react-bootstrap";
import { FontAwesomeIcon } from 'react-fontawesome';

const PlayBackControls = props => {

    return (
        <div className="play-back-controls">
            <Button className={"btn-play-" + props.name }> <FontAwesomeIcon className="fas fa-play" /></Button>
            <Button className={"btn-cue-" + props.name }> cue </Button>
        </div>
    )
}

export default PlayBackControls;
